function GetRelativeData(n){HttpGet(`/RequestForProceedingEviction/GetRelativeData/?CancellationId=${n}`,"json",function(n){n!=null&&($("#AllotmentId").val(n.allotmentId),$("#CancellationId").val(n.id),$("#Society_name").val(n.allotment.application.name),$("#Purpose_name").val(n.allotment.leasePurposesType.purposeUse))})}$(document).ready(function(){var n=$("#CancellationId").find(":selected").attr("value");GetRelativeData(n)});